      <p>
        <Link href="/about">
          <a>About</a>
        </Link>
      </p>
    </Layout>
  );
};

Index.getInitialProps = async (context: any) => {
  const { data } = await isAuthenticated(context);
  if (data) {
    return {
      isLoggedIn: true
    };
  }
  return {
    isLoggedIn: false
  };
};

export default Index;
